import {Listaclienti} from '../../actions/authAutentications';
import React, { Component } from 'react';

import PropTypes from 'prop-types';
import { connect } from 'react-redux';

class AggiornaClienti extends Component {
 
  
 async componentDidMount() {
   await this.props.Listaclienti();
 }

viewCustomer(id){
console.log(id);

}
 
  render() {
    const { user } = this.props.auth;
    if(user.ruolo==="Cliente")
    this.props.history.push("/HomeCliente")
   const {user1}=this.props.customerlist;
   const CL=(
<div className="container">
<div class="center">
 <table class="responsive-table">

 <thead>

<tr>

<th >Name</th>
<th >cognome</th>
<th >Email</th>

</tr>

 </thead>
 <tbody>
   {
    user1.map((user1)=>
    <tr key={user1._id}>
      <td>{user1.name}</td>
      <td>{user1.cognome}</td>
      <td>{user1.email}</td>
    </tr>
    
    )}

   
 </tbody>
 </table>
</div>
</div>

   )
    
	return(
    <div className="row">
    {
      user1.length===0?'NO USERS or server is offline':CL
    }
    </div>
  );
   
  }
}

 
   



AggiornaClienti.propTypes = {
 Listaclienti:PropTypes.func.isRequired,

 auth:PropTypes.object.isRequired,
 errors:PropTypes.object.isRequired,
customerlist:PropTypes.object.isRequired,

};
const mapStateToProps = state => ({
  auth:state.auth,
  errors:state.errors,
  customerlist:state.customerlist
});
export default connect(mapStateToProps, 
 {Listaclienti})
  (AggiornaClienti);
